import { useDispatch } from 'react-redux';

import weatherIcon from '../../assets/image/weatherIcon.png';

import { changeTheme } from '../../store/thunk/action/app';

import CustomButton from '../customButton/CustomButton';
import SearchInput from '../searchInput/SearchInput';

import { HeaderWrapper } from './styledComponents/Header';

const Header = () => {
  const dispatch = useDispatch();

  const onChangeTheme = () => {
    dispatch(changeTheme());
  };
  return (
    <HeaderWrapper>
      <div className="weatherHeaderItems">
        <div style={{display: 'flex', justifyContent: 'space-between', alignItems: 'center'}}>
          <img src={weatherIcon} alt="weatherIcon" />
          <h1>Weather App</h1>
        </div>
        <button>thunk</button>
      </div>
      <div className="weatherItems">
        <SearchInput />
        <CustomButton />
      </div>
    </HeaderWrapper>
  );
};

export default Header;
